import "./App.css";
import * as React from "react";
import Dashboard from "./pages/Dashboard";

import { Routes, Route, Router } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Dashboard />}></Route>
    </Routes>
  );
}

export default App;
